  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report details the
  conditions and management of Stillwater National Wildlife Refuge in 1983.  The report
  begins with the highlights and climatic conditions of the year, followed by information
  about the acquisition of the refuge.  The refugeu2019s management plans and administration
  are discussed next.  The following section covers habitat management and includes:
  wetlands, forests, croplands, grasslands, grazing, haying, fire management, pest
  control, and water rights.  Wildlife is discussed next with emphasis on endangered
  species, waterfowl, raptors, migratory birds, marine mammals, and fish.  Public
  use; such as hunting, fishing, camping, and trapping; is also described in this
  report.  Finally, the report discusses information about equipment and facilities.
  \ Descriptions of Anaho Island National Wildlife Refuge and Fallon National Wildlife
  Refuge are also given.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
